      border-color: $freud-btn-border;
      color: $freud-btn-color;
    }
  }
  
  &.freud-btn-color-secondary {
    $freud-btn-background: $neutral-color-white;
    $freud-btn-color: $brand-color-pure;
    $freud-btn-border: $brand-color-pure;
    .p-button {
      background-color: $freud-btn-background;
      border-color: $freud-btn-border;
      color: $freud-btn-color;
    }
  }
  
  &.freud-btn-color-ghost {
    $freud-btn-background: transparent;
    $freud-btn-color: $brand-color-pure;
    $freud-btn-border: transparent;
    .p-button {
      background-color: $freud-btn-background;
      border-color: $freud-btn-border;
      color: $freud-btn-color;
    }
  }

  .p-button:enabled:hover {
    background: $brand-color-01;
    border-color: $brand-color-01;
    color: $brand-color-pure;
  }
}

.freud-btn.freud-btn-bgcolor {
  &.freud-btn-color-primary {
    .p-button {
      background-color: $neutral-color-white;
      border-color: $neutral-color-white;
      color: $brand-color-pure;
    }
  }
  
  &.freud-btn-color-secondary {
    .p-button {
      background-color: $brand-color-pure;
      border-color: $neutral-color-white;
      color: $neutral-color-white;
    }
  }
  
  &.freud-btn-color-ghost {
    .p-button {
      background-color: transparent;
      border-color: transparent;
